import "../css/login.css";
import loginBanner from "../img/loginBanner.png";
import logo from "../img/logo.png";
const Login = () => {
  return (
    <div className="container">
      <div className="bannerContainer">
        <h1>Restez Connectés au monde</h1>
        <p>Rejoignez des millions sans attendre</p>
        <img src={loginBanner} alt=""></img>
      </div>
      <div className="loginContainer">
        <div className="loginHeader">
          <img src={logo} alt="logo"></img>
          <p>
            Pas de compte? <span className="signupLink">Inscrivez-vous</span>
          </p>
        </div>
        <h1>Mettez un pas dans le nouveau monde</h1>
        <div className="formContainer">
          <h3>Plonger dans Twister</h3>
          <input id="username" type="text"></input>
          <input id="password" type="password"></input>
          <p className="forgetPassword">Mot de passe oublié?</p>
          <Button></Button>
        </div>
      </div>
    </div>
  );
};

export default Login;
